cy.wait(4000);
cy.get('[loading="lazy"]').invoke('attr', 'srcset').then(prevBackground => {
  cy.reload();
  cy.wait(4000);
  cy.get('[loading="lazy"]').invoke('attr', 'srcset').then(currBackground => {
    cy.expect(currBackground).to.not.equal(prevBackground);
  });
});

